        });
}


export const loginUser = async (req, res) => {
    let mail = req.body.Mail;
    let password = req.body.Contrasenia;

    User.findOne({
        where: { Mail: mail },
        attributes: ['ID', 'Mail', 'Contrasenia', 'Nombre', 'Apellido', 'Telefono1'],
