    var IdTipoClase = req.body.ID;

    var query = `DELETE FROM tipoclase
                WHERE ID = ${IdTipoClase}`;

    console.log(query);
    return pool.promise().query(query)
        .then(() => { return ({ Success: true }) })
        .catch((err) => { return ({ Success: false, Data: err }) });
}

